import React from "react";
import "../style/Company.css";
import logo from "../images/Logo-hd.png";


export const Contact = () => {
    return (
        <div className="container justify-content-center align-items-center Container">
        <div className="img-container">
        <img src={logo} width="250px" />
        </div>
        <h1>Contact</h1>
        <div class="container mt-3">
        <h2>Card Image Overlay</h2>
        <p>Turn an image into a card background and use .card-img-overlay to overlay the card's text:</p>
        <div class="card img-fluid" style="width:500px">
            <img class="card-img-top" src="" alt="Card image" style="width:100%"/>
            <div class="card-img-overlay">
            <h4 class="card-title">John Doe</h4>
            <p class="card-text">Some example text some example text. Some example text some example text. Some example text some example text. Some example text some example text.</p>
            <a href="#" class="btn btn-primary">See Profile</a>
            </div>
        </div>
        </div>
        </div>
    );
}
